(()=>{return(e,t)=>{const r=t.import("framePlaybackHtml");t.applyStyle("framePlaybackStyle");const c=async()=>{if(document.querySelector(".frame-playback")){return}const e=await SpinQuery.select(()=>document.querySelector("video"));const t=await SpinQuery.select(()=>document.querySelector(".bilibili-player-video-control-bottom-left"));t.insertAdjacentHTML("beforeend",r);const c=parseInt(await SpinQuery.select(()=>document.querySelector(".bilibili-player-video-quality-menu .bui-select-item-active")));const n=(()=>{switch(c){case 116:case 74:return 60;default:return 30}})();const i=1/n;document.querySelector(".prev-frame").addEventListener("click",()=>e.currentTime-=i);document.querySelector(".next-frame").addEventListener("click",()=>e.currentTime+=i)};Observer.videoChange(c)}})();